The Babysitters (2007)

Verenigde Staten
Drama

90 minuten
geregisseerd door David Ross
met John Leguizamo, Katherine Waterston en Cynthia Nixon

High school scholiere Shirley werkt als babysitter om wat bij te verdienen. Ze is smoorverliefd op Michael, de vader van twee van de kinderen waar ze op past. Op een avond komt het tot een verboden samenzijn en Michael geeft haar een bonus bovenop haar normale vergoeding. Als Michaels vrienden hier van horen willen ze ook wel wat van deze hete babysitter-actie. Voor ze het weet wordt Shirley een highschool babysittermadam die afspraakjes regelt tussen haar vriendinnen en oversexte echtgenoten.

Vanaf 3 februari in de videotheek


